const GET_ENTITY_COLOR = (entity) => {
  const label =
    entity.charAt(0) === entity.charAt(0).toLowerCase()
      ? entity
      : entity.charAt(0).toLowerCase() + entity.slice(1).replace(/\s/g, "");
  switch (label) {
    case "initiatives":
    case "stakeholders":
      return "#bdc3c7";
    case "concerns":
      return "#F29B30";
    case "coordinationPatterns":
      return "#9b59b6";
    case "methodologyPatterns":
      return "#3498db";
    case "visualizationPatterns":
      return "#4EBA6F";
    case "principles":
      return "#34495e";
    case "antiPatterns":
      return "#e74c3c";
    default:
      "#bdc3c7";
  }
};

